(12395,1163,'description','Dina El Wedidi is an Egyptian new folk and fusion singer, composer and guitarist. She will be performing her original acoustic compositions, reflecting her thoughts on political and social issues with her expressive voice and engaging lyrics.\r\n\r\nhttps://www.youtube.com/user/dinaelwedidi1'),(12396,1163,'_description','field_5895032b1386e'),(12397,1163,'performing_artists',''),(12398,1163,'_performing_artists','field_5895035f1386f'),(12399,1163,'date','20161115'),(12400,1163,'_date','field_5895038913870'),(12401,1163,'slide_template','default'),(12402,1164,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12403,1164,'_thumbnail_id','511'),(12404,1164,'description','Safi and Ramy The #DJunkie are at it again with some Dirrrty POP! Prepare to get down and dirrrty to some of your favorite 90s pop jams.'),(12405,1164,'_description','field_581ce61d9b4f8'),(12406,1164,'performing_artists',''),(12407,1164,'_performing_artists','field_574a092282648'),(12408,1164,'date','20161207'),(12409,1164,'_date','field_574a095782649'),(12410,1164,'slide_template','default'),(12411,1165,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12412,1165,'_edit_last','1'),(12413,1166,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12414,1166,'_edit_last','1'),(12415,1166,'description',''),(12416,1166,'_description','field_5895032b1386e'),(12417,1166,'performing_artists',''),(12418,1166,'_performing_artists','field_5895035f1386f'),(12419,1166,'date',''),(12420,1166,'_date','field_5895038913870'),(12421,1166,'slide_template','default'),(12422,1143,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12423,1143,'_edit_last','1'),(12424,1143,'description','Siblings and DJ duo Gawdat started their career playing at underground and house parties, and now they pull a huge, energetic crowd wherever they play their tech and deep house sets! Join us for the first Manic Monday of the month, because these guys are sure to get the month off to a good start.'),(12425,1143,'_description','field_5895032b1386e'),(12426,1143,'performing_artists','a:1:{i:0;s:3:\"706\";}'),(12427,1143,'_performing_artists','field_5895035f1386f'),(12428,1143,'date','20170102'),(12429,1143,'_date','field_5895038913870'),(12430,1143,'slide_template','default'),(12431,1143,'_thumbnail_id','1030'),(12432,1167,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12433,1167,'_edit_last','1'),(12434,1167,'_thumbnail_id','1057'),(12435,1167,'description','We bring you a night of the most interesting electronic music that Egypt has to offer! Telepoetic will mesmerize you with their skilled and calculated use of instruments and synthesizers. Machine Eat Man will then continue this electronic journey and blow your mind with his unique Electronica sound.'),(12436,1167,'_description','field_5895032b1386e'),(12437,1167,'performing_artists','a:2:{i:0;s:3:\"874\";i:1;s:3:\"736\";}'),(12438,1167,'_performing_artists','field_5895035f1386f'),(12439,1167,'date','20170103'),(12440,1167,'_date','field_5895038913870'),(12441,1167,'slide_template','default'),(12442,1168,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12443,1168,'_edit_last','1'),(12444,1168,'description',''),(12445,1168,'_description','field_581ce61d9b4f8'),(12446,1168,'performing_artists',''),(12447,1168,'_performing_artists','field_574a092282648'),(12448,1168,'date',''),(12449,1168,'_date','field_574a095782649'),(12450,1168,'slide_template','default'),(12451,1169,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12452,1169,'_edit_last','1'),(12453,1169,'_thumbnail_id','1061'),(12454,1169,'description','DJ Feedo is back for another night of gettin down and breakin\' it down at CJC! Putting the hip in hip hop, Feedo will be playing a heavy dose of RnB and Hip Hop, spinning everything from old school to your favorite current hits!\r\n'),(12455,1169,'_description','field_5895032b1386e'),(12456,1169,'performing_artists','a:1:{i:0;s:3:\"844\";}'),(12457,1169,'_performing_artists','field_5895035f1386f'),(12458,1169,'date','20170104'),(12459,1169,'_date','field_5895038913870'),(12460,1169,'slide_template','default'),(12461,1170,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12462,1170,'_thumbnail_id','1063'),(12463,1170,'_edit_last','1'),(12464,1170,'description','Its time for Thursday Night Live, which means a night for some great live music to kick off your weekend! \r\nBluezophrenia will rock the house with their spot-on blues and rock n roll. Screwdriver Band skillfully cover all your favorite hits and ensure you dont stop dancing as always.\r\n'),(12465,1170,'_description','field_5895032b1386e'),(12466,1170,'performing_artists','a:2:{i:0;s:3:\"804\";i:1;s:3:\"726\";}'),(12467,1170,'_performing_artists','field_5895035f1386f'),(12468,1170,'date','20170105'),(12469,1170,'_date','field_5895038913870'),(12470,1170,'slide_template','default'),(12471,1171,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12472,1171,'_edit_last','1'),(12474,1171,'description','DJ Fabric is back at CJC after a very long time! It\'s Friday Fever and you can depend on DJs Fabric and Special K get the weekend started on an upbeat note with their house sets! \r\n'),(12475,1171,'_description','field_5895032b1386e'),(12476,1171,'performing_artists','a:1:{i:0;s:3:\"751\";}'),(12477,1171,'_performing_artists','field_5895035f1386f'),(12478,1171,'date','20170106'),(12479,1171,'_date','field_5895038913870'),(12480,1171,'slide_template','default'),(12481,1172,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12482,1172,'_thumbnail_id','1033'),(12483,1172,'_edit_last','1'),(12484,1172,'description','For this weeks edition of Saturday LOriental, Storm Band takes traditional Egyptian songs and breathes new life into them, creating a connection to todays Egyptian youth. Their unique sound will blow you away.\r\n\r\nSticking to the traditional, the upper Egyptian musician Basheer will sing his captivating folk music which is sure to take you to another time and place. \r\n'),(12485,1172,'_description','field_5895032b1386e'),(12486,1172,'performing_artists','a:2:{i:0;s:3:\"717\";i:1;s:3:\"865\";}'),(12487,1172,'_performing_artists','field_5895035f1386f'),(12488,1172,'date','20170107'),(12489,1172,'_date','field_5895038913870'),(12490,1172,'slide_template','default'),(12491,1173,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12492,1173,'_edit_last','1'),(12493,1173,'_thumbnail_id','1078'),(12494,1173,'description','The 15+ man formation that is The Big Band Society elegantly plays jazz like youve never heard it before! To add some Latin flare to this jazzy evening, prepare to be dazzled by Cocoon BAND\'s Latin and Cuban jazz!'),(12495,1173,'_description','field_5895032b1386e'),(12496,1173,'performing_artists','a:2:{i:0;s:3:\"830\";i:1;s:3:\"815\";}'),(12497,1173,'_performing_artists','field_5895035f1386f'),(12498,1173,'date','20170108'),(12499,1173,'_date','field_5895038913870'),(12500,1173,'slide_template','default'),(12501,1174,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12502,1174,'_thumbnail_id','1082'),(12503,1174,'_edit_last','1'),(12504,1174,'description','This weeks edition of #AltTuesday brings you a back-to-roots type of night. \r\n\r\nInfluenced by his versatile background, Ahmed omar uses the different cultures that shaped his identity as inspiration for his musical creativity and produces a delightful blend of African and Arabic music.\r\n\r\nBetween Asia Madani\'s unforgettable folky Sudanese vocals and the sound of her percussion, she provides a traditional yet unique sound. '),(12505,1174,'_description','field_5895032b1386e'),(12506,1174,'performing_artists',''),(12507,1174,'_performing_artists','field_5895035f1386f'),(12508,1174,'date','20170110'),(12509,1174,'_date','field_5895038913870'),(12510,1174,'slide_template','default'),(12511,1175,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12512,1175,'_edit_last','1'),(12513,1175,'_thumbnail_id','1086'),(12514,1175,'description','Don\'t blame it on the sunshine\r\nDon\'t blame it on the moonlight\r\nDon\'t blame it on the good times\r\nBlame it on the BOOGIE! \r\n\r\nRamy The #DJunkie brings us another wild Boogie Night! Leave your worries at the door and prepare to dance the night away.'),(12515,1175,'_description','field_5895032b1386e'),(12516,1175,'performing_artists','a:1:{i:0;s:3:\"700\";}'),(12517,1175,'_performing_artists','field_5895035f1386f'),(12518,1175,'date','20170111'),(12519,1175,'_date','field_5895038913870'),(12520,1175,'slide_template','default'),(12521,1176,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12522,1176,'_edit_last','1'),(12523,1176,'_thumbnail_id','1101'),(12524,1176,'description','We bring you yet another Thursday Night Live with the best that the local live music scene has to offer! Singer and guitarist Danny Malak covers the best pop and rock hits with a soft acoustic spin.\r\n\r\nHassan Ramzy Band will be playing in their new, full-on band formation, where they will be performing exciting original alternative and indie rock songs. '),(12525,1176,'_description','field_5895032b1386e'),(12526,1176,'performing_artists','a:1:{i:0;s:3:\"860\";}'),(12527,1176,'_performing_artists','field_5895035f1386f'),(12528,1176,'date','20170112'),(12529,1176,'_date','field_5895038913870'),(12530,1176,'slide_template','default'),(12531,1177,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12532,1177,'_edit_last','1'),(12533,1177,'_thumbnail_id','1122'),(12534,1177,'description','One of the most popular and regular CJC DJ Mohasseb is back for yet another unforgettable night of your favorite progressive house tracks! These nights usually need no introduction because Mohasseb has long established himself as a party starter at CJC.'),(12535,1177,'_description','field_5895032b1386e'),(12536,1177,'performing_artists','a:1:{i:0;s:3:\"708\";}'),(12537,1177,'_performing_artists','field_5895035f1386f'),(12538,1177,'date','20170113'),(12539,1177,'_date','field_5895038913870'),(12540,1177,'slide_template','default'),(12541,1178,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12542,1178,'_edit_last','1'),(12543,1178,'description','Alexandrian band Almena -  will be joining us this Saturday, playing guitar-led contemporary Arabic music inspired by a variety of world music. \r\n\r\nAlso joining us on this Arabic musical evening is Hawas , an independent Egyptian band that presents alternative music which aims at exploring new musical dimensions through mixing different genres. They define their unique sound as \"Neo-Egyptian Pop.\"'),(12544,1178,'_description','field_5895032b1386e'),(12545,1178,'performing_artists','a:2:{i:0;s:3:\"861\";i:1;s:3:\"712\";}'),(12546,1178,'_performing_artists','field_5895035f1386f'),(12547,1178,'date','20170114'),(12548,1178,'_date','field_5895038913870'),(12549,1178,'slide_template','default'),(12550,1178,'_thumbnail_id','1119'),(12551,1179,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12552,1179,'_edit_last','1'),(12553,1179,'_thumbnail_id','1116'),(12554,1179,'description','Tech house experts Baher and Ouzo will be joining us this Monday for a night where you leave your worries at the door, and focus on your dancing and their kick-ass sets! \r\n'),(12555,1179,'_description','field_5895032b1386e'),(12556,1179,'performing_artists','a:2:{i:0;s:3:\"876\";i:1;s:3:\"764\";}'),(12557,1179,'_performing_artists','field_5895035f1386f'),(12558,1179,'date','20170109'),(12559,1179,'_date','field_5895038913870'),(12560,1179,'slide_template','default'),(12561,1180,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12562,1180,'_edit_last','4'),(12564,1180,'description','As the name suggests, Bluenotes are all about the blues! The band is a blues-rock formation that draws influences from several types of blues music. Expect growling vocals, a soulful harmonica, and screaming guitars!'),(12565,1180,'_description','field_5895032b1386e'),(12566,1180,'performing_artists',''),(12567,1180,'_