w, full-on band formation, where they will be performing exciting original alternative and indie rock songs. '),(12605,1220,'_description','field_5895032b1386e'),(12606,1220,'performing_artists','a:1:{i:0;s:3:\"860\";}'),(12607,1220,'_performing_artists','field_5895035f1386f'),(12608,1220,'date','20170112'),(12609,1220,'_date','field_5895038913870'),(12610,1220,'slide_template','default'),(12611,1222,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12612,1222,'_thumbnail_id','1098'),(12613,1222,'_edit_last','1'),(12614,1222,'description','These funky DJ\'s cover the dance music spectrum drawing from funk, disco, soul and everything in between! Other than playing thumping dance beats, these guys love to regularly feature artists to keep their sound exciting and fresh, and this time theyre bringing in none other than local music pioneer and renowned guitarist Ousso! This should be a show for the books, expect high energy and dancing till the wee hours of the morning!'),(12615,1222,'_description','field_5895032b1386e'),(12616,1222,'performing_artists',''),(12617,1222,'_performing_artists','field_5895035f1386f'),(12618,1222,'date','20170116'),(12619,1222,'_date','field_5895038913870'),(12620,1222,'slide_template','default'),(12621,1224,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12622,1224,'_thumbnail_id','1095'),(12623,1224,'_edit_last','1'),(12624,1224,'description','17-	Hend El Rawy/ The Meteors project: We\'ve got a very special Alt Tuesday for you this week! Playing with the traditional, the folk, the electronic and the experimental, we cross boundaries and blur musical lines all within a few hours and under one roof! \r\nWe are extremely pleased to welcome the talented vocalist Hend El Rawy on our stage! Being a musician from an early age, Hend is no stranger to a variety of genres and doesnt shy away from the idea of mixing and creating fusions using her upbringing within traditional Egyptian folk and exposure to modern Western sounds, be it electronic or rock music. Hend joined the French band Orange Blossom a few years back and toured all over Europe, offering their loyal fans a unique blend of folk music mixed with electronic sounds. Now Hend is back in Egypt and has formed her very own band! This new formation will be playing original folk-rock fusion songs as well as some songs from Orange Blossom this Tuesday. Dont miss this unique display of local talent. \r\n\r\nInspired by everything between early prog-rock, trip hop and neo-classical and techno, The Meteors Project will play one of their captivating live electronic sets. Their new EP Swimming with Astronauts is definitely worth checking out and will be even better live! \r\n'),(12625,1224,'_description','field_5895032b1386e'),(12626,1224,'performing_artists','a:2:{i:0;s:3:\"858\";i:1;s:3:\"788\";}'),(12627,1224,'_performing_artists','field_5895035f1386f'),(12628,1224,'date','20170117'),(12629,1224,'_date','field_5895038913870'),(12630,1224,'slide_template','default'),(12631,1226,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12632,1226,'_thumbnail_id','1092'),(12633,1226,'_edit_last','1'),(12634,1226,'description','Named after the band\'s lead singer, Sorour is distinguishable by Mohamed Sorour\'s resonant voice and the sound of traditional Arabic folk music fused with influences from around the world.\r\n\r\nHawidro, meaning \'the return\' in Nubian, take their audience back to Mother Africa with multiple influences from the region, which they  combine with international sounds, making them the unique band that they are. \r\n'),(12635,1226,'_description','field_5895032b1386e'),(12636,1226,'performing_artists','a:1:{i:0;s:3:\"709\";}'),(12637,1226,'_performing_artists','field_5895035f1386f'),(12638,1226,'date','20170121'),(12639,1226,'_date','field_5895038913870'),(12640,1226,'slide_template','default'),(12641,1228,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12642,1228,'_thumbnail_id','1089'),(12643,1228,'_edit_last','1'),(12644,1228,'description','We are happy to host one of Egypts favorite and longest standing contemporary bands, Wust El Balad '),(12645,1228,'_description','field_5895032b1386e'),(12646,1228,'performing_artists','a:1:{i:0;s:3:\"690\";}'),(12647,1228,'_performing_artists','field_5895035f1386f'),(12648,1228,'date','20170124'),(12649,1228,'_date','field_5895038913870'),(12650,1228,'slide_template','default'),(12651,1230,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12652,1230,'_thumbnail_id','1659'),(12653,1230,'_edit_last','1'),(12654,1230,'description','Fun, Easy, upbeat and dancey! These are all things that you can expect on this night along with a heavy dose of nostalgia as you listen to some 90s favorites!'),(12655,1230,'_description','field_5895032b1386e'),(12656,1230,'performing_artists','a:1:{i:0;s:3:\"700\";}'),(12657,1230,'_performing_artists','field_5895035f1386f'),(12658,1230,'date','20170125'),(12659,1230,'_date','field_5895038913870'),(12660,1230,'slide_template','default'),(12661,1232,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12662,1232,'_thumbnail_id','1051'),(12663,1232,'_edit_last','1'),(12664,1232,'description','This veteran DJ knows how to get a party started and keep the crowd moving all night long! Established both locally and abroad, Hisham Zahran is unarguably one of the best house DJ\'s in the scene.'),(12665,1232,'_description','field_5895032b1386e'),(12666,1232,'performing_artists','a:2:{i:0;s:3:\"812\";i:1;s:3:\"814\";}'),(12667,1232,'_performing_artists','field_5895035f1386f'),(12668,1232,'date','20170127'),(12669,1232,'_date','field_5895038913870'),(12670,1232,'slide_template','default'),(12671,1234,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12672,1234,'_thumbnail_id','1048'),(12673,1234,'_edit_last','1'),(12674,1234,'description','A Squared celebrate their second anniversary at CJC! Were proud to have had this duo play regularly on our decks over the past couple of years and we invite you to come cheers to many more years to come!'),(12675,1234,'_description','field_5895032b1386e'),(12676,1234,'performing_artists',''),(12677,1234,'_performing_artists','field_5895035f1386f'),(12678,1234,'date','20170130'),(12679,1234,'_date','field_5895038913870'),(12680,1234,'slide_template','default'),(12681,1236,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12682,1236,'_thumbnail_id','1045'),(12683,1236,'_edit_last','1'),(12684,1236,'description','This Alt Tuesday celebrates local indie music! Singer/songwriter Ahmed Safi plays an acoustic set of his indie original songs from his band, Sukoon as well as some covers. Expect a delectable fusion of Eastern and jazzy sounds. '),(12685,1236,'_description','field_5895032b1386e'),(12686,1236,'performing_artists','a:1:{i:0;s:3:\"747\";}'),(12687,1236,'_performing_artists','field_5895035f1386f'),(12688,1236,'date','20170131'),(12689,1236,'_date','field_5895038913870'),(12690,1236,'slide_template','default'),(12691,1238,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12692,1238,'_thumbnail_id','1038'),(12693,1238,'_edit_last','1'),(12694,1238,'description','As intriguing as their name is, once you hear these guys play youll find their special electro-punk indie rock sound is even more intriguing! Not only will the Lebanese band be playing at CJC for the very first time, but this is also your last chance to catch them in the Middle East Region till October 2017! \r\n\r\nSafi will make sure that the beginning and end of the night is just as delectable as the middle with his unique Oriental Electronica.'),(12695,1238,'_description','field_5895032b1386e'),(12696,1238,'performing_artists','a:2:{i:0;s:3:\"853\";i:1;s:3:\"702\";}'),(12697,1238,'_performing_artists','field_5895035f1386f'),(12698,1238,'date','20170119'),(12699,1238,'_date','field_5895038913870'),(12700,1238,'slide_template','default'),(12701,1242,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(12702,1242,'_edit_last','1'),(12703,1242,'_thumbnail_