ence. He has received recognition across the Middle East for his musical achievements through awards and mentions. '),(13967,1716,'_description','field_5895032b1386e'),(13968,1716,'performing_artists','a:2:{i:0;s:3:\"401\";i:1;s:3:\"788\";}'),(13969,1716,'_performing_artists','field_5895035f1386f'),(13970,1716,'date','20170209'),(13971,1716,'_date','field_5895038913870'),(13972,1716,'slide_template','default'),(13973,1716,'eg_sources_html5_mp4',''),(13974,1716,'eg_sources_html5_ogv',''),(13975,1716,'eg_sources_html5_webm',''),(13976,1716,'eg_sources_youtube',''),(13977,1716,'eg_sources_vimeo',''),(13978,1716,'eg_sources_wistia',''),(13979,1716,'eg_sources_image',''),(13980,1716,'eg_sources_iframe',''),(13981,1716,'eg_sources_soundcloud',''),(13982,1716,'eg_vimeo_ratio','0'),(13983,1716,'eg_youtube_ratio','0'),(13984,1716,'eg_wistia_ratio','0'),(13985,1716,'eg_html5_ratio','0'),(13986,1716,'eg_soundcloud_ratio','0'),(13987,1716,'eg_settings_custom_meta_skin',''),(13988,1716,'eg_settings_custom_meta_element',''),(13989,1716,'eg_settings_custom_meta_setting',''),(13990,1716,'eg_settings_custom_meta_style',''),(13991,1718,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(13992,1718,'_edit_lock','1486584519:1'),(13993,1718,'_edit_last','4'),(13994,1719,'_wp_attached_file','2017/02/Feb-10-insta.jpg'),(13995,1719,'_wp_attachment_metadata','a:5:{s:5:\"width\";i:1000;s:6:\"height\";i:1000;s:4:\"file\";s:24:\"2017/02/Feb-10-insta.jpg\";s:5:\"sizes\";a:13:{s:9:\"thumbnail\";a:4:{s:4:\"file\";s:24:\"Feb-10-insta-150x150.jpg\";s:5:\"width\";i:150;s:6:\"height\";i:150;s:9:\"mime-type\";s:10:\"image/jpeg\";}s:6:\"medium\";a:4:{s:4:\"file\";s:24:\"Feb-10-insta-300x300.jpg\";s:5:\"width\";i:300;s:6:\"height\";i:300;s:9:\"mime-type\";s:10:\"image/jpeg\";}s:12:\"medium_large\";a:4:{s:4:\"file\";s:24:\"Feb-10-insta-768x768.jpg\";s:5:\"width\";i:768;s:6:\"height\";i:768;s:9:\"mime-type\";s:10:\"image/jpeg\";}s:4:\"blog\";a:4:{s:4:\"file\";s:24:\"Feb-10-insta-960x500.jpg\";s:5:\"w