nd exposure to modern Western sounds, be it electronic or rock music. Hend joined the French band Orange Blossom a few years back and toured all over Europe, offering their loyal fans a unique blend of folk music mixed with electronic sounds. Now Hend is back in Egypt and has formed her very own band! This new formation will be playing original folk-rock fusion songs as well as some songs from Orange Blossom this Tuesday. \r\nDont miss this unique display of local talent. \r\n'),(14127,1727,'_description','field_5895032b1386e'),(14128,1727,'performing_artists','a:1:{i:0;s:3:\"858\";}'),(14129,1727,'_performing_artists','field_5895035f1386f'),(14130,1727,'date','20170214'),(14131,1727,'_date','field_5895038913870'),(14132,1727,'eg_sources_html5_mp4',''),(14133,1727,'eg_sources_html5_ogv',''),(14134,1727,'eg_sources_html5_webm',''),(14135,1727,'eg_sources_youtube',''),(14136,1727,'eg_sources_vimeo',''),(14137,1727,'eg_sources_wistia',''),(14138,1727,'eg_sources_image',''),(14139,1727,'eg_sources_iframe',''),(14140,1727,'eg_sources_soundcloud',''),(14141,1727,'eg_vimeo_ratio','0'),(14142,1727,'eg_youtube_ratio','0'),(14143,1727,'eg_wistia_ratio','0'),(14144,1727,'eg_html5_ratio','0'),(14145,1727,'eg_soundcloud_ratio','0'),(14146,1727,'eg_settings_custom_meta_skin',''),(14147,1727,'eg_settings_custom_meta_element',''),(14148,1727,'eg_settings_custom_meta_setting',''),(14149,1727,'eg_settings_custom_meta_style',''),(14150,1732,'_vc_post_settings','a:1:{s:10:\"vc_grid_id\";a:0:{}}'),(14152,1732,'_edit_lock','1486391875:4'),(14153,1733,'_wp_attached_file','2017/02/Feb-15-insta.jpg'),(14154,1733,'_wp_attachment_metadata','a:5:{s:5:\"width\";i:1000;s:6:\"height\";i:1000;s:4:\"file\";s:24:\"2017/02/Feb-15-insta.jpg\";s:5:\"sizes\";a:15:{s:9:\"thumbnail\";a:4:{s:4:\"file\";s:24:\"Feb-15-insta-150x150.jpg\";s:5:\"width\";i:150;s:6:\"height\";i:150;s:9:\"mime-type\";s:10:\"image/jpeg\";}s:6:\"medium\";a:4:{s:4:\"file\";s:24:\"Feb-15-insta-300x300.jpg\";s:5:\"width\";i:300;s:6:\"